import React, { Component } from 'react';
class BasicDetails extends Component{
    constructor(){
        super();
        this.changeUserName = this.changeUserName.bind(this);
    }
    changeUserName(){
        this.props.userName = document.getElementById("userNameInput").value;
    }
    render() {
        return (
             <div className='BasicDetails'>
                 <input onChange={this.changeUserName} id="userNameInput" placeholder='User name'></input>
             </div>
        );
    }
}
export default BasicDetails;
